    if (!startString || !set || !(set instanceof Set) || typeof startString !== 'string' || startString.length !== 0) {
        return '';
    }

    let setList = [];

    for (const item of set) {
        if (item.startsWith(startString)) {
            setList.push(item.substring(startString.length));
        }
    }
    return setList.join('-');
}

